import { Component, OnInit } from '@angular/core';
import { Session } from 'src/app/config/config-data'
import { AuthenticationDataService } from './services/authentication-data.service';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent{

  title:string = 'portfolio';
  IsLogin:string = Session.IS_LOGIN? "logged":"";

  constructor(private dataService:PersonDataService){}

  ngOnInit() {
    this.isLogin = this.dataService.isSessionValid() ? 'logged' : '';
  }
}
